import React from 'react';
import Pin from './Pin.js';

const PinList = (props = []) => {

  const toggleGrandparentInput = (id) => {
    props.togglePinInput(value)
  }
  return (
    <React.Fragment>
      {(props.pins.length > 0)
        ? props.pins.map((x) =>
          <Pin key={x.id} info={x} toggleParentInput={() => this.toggleGrandparentInput(id)} browserSize={props.browserSize} />
        )
        : null }
    </React.Fragment>
  )
}

export default PinList;
